function App() {
  return (
    <div>
      <link
        href="https://fonts.googleapis.com/css2?family=Montserrat:wght@100&display=swap"
        rel="stylesheet"
      ></link>
      <NavigationContainer />
      <SectionOne />
    </div>
  );
}

export default App;
